import { Box, Typography } from "@mui/material";
import React from "react";
import logo from "../../images/logo_aurora-06.png" 

export const Logo = () => {

    const altLogo="logoHeader"
    const sizeLogo="100px"


    return (
        <>
        <Box>
            <Link to="/home" >
            <img src={logo}  alt={altLogo} height={sizeLogo} />     
            </Link>
        </Box>            
        </>
    );
};
